  false,\n\t\"url\": null,\n\t\"notes\": \"New York City school level College Board
  SAT results for the graduating seniors of 2010.  Records contain 2010 College-bound
  seniors mean SAT scores. rnrnRecords with 5 or fewer students are suppressed (marked
  u2018su2019). rnrnCollege-bound seniors are those students that complete the SAT
  Questionnaire when they register for the SAT and identify that they will graduate
  from high school in a specific year. For example, the 2010 college-bound seniors
  are those students that self-reported they would graduate in 2010. Students are
  not required to complete the SAT Questionnaire in order to register for the SAT.
  Students who do not indicate which year they will graduate from high school will
  not be included in any college-bound senior report.  rnrnStudents are linked to
  schools by identifying which school they attend when registering for a College Board
  exam. A student is only included in a schoolu2019s report if he/she self-reports
  being enrolled at that school. rnrnData collected and processed by the College Board.\",\n\t\"license_title\":
